const t={type:"join_us.JoinUs",detail_url:"http://localhost/api/v2/pages/17/",html_url:null,slug:"join-us",show_in_menus:!1,seo_title:"",search_description:"",first_published_at:"2023-06-10T07:50:10.693913Z",alias_of:null,parent:{id:13,meta:{type:"base.Base",detail_url:"http://localhost/api/v2/pages/13/",html_url:null},title:"BAID 官网"},locale:"zh"},e="加入我们",a=["https://cms.beijing.academy/media/original_images/DSC_5476.webp"],l='<p data-block-key="vc1al">中美高中课程合作项目开设AP课程，欢迎初三学生积极报考。期待你们的加入！</p>',s="Test",c='<p data-block-key="rlm60">test</p>',i="https://cms.beijing.academy/media/original_images/DSC_5476.webp",o=[{id:1,meta:{type:"join_us.ImageCard"},name:"项目学费",content:'<p data-block-key="03kvr">每学期 5 万元人民币 (不含住宿费、教材费、伙食费、校服费等)。</p>',image:"https://cms.beijing.academy/media/original_images/DSC_5476.webp"},{id:2,meta:{type:"join_us.ImageCard"},name:"Card2",content:'<p data-block-key="b0sh4">asdjioasjdioasjdioasjdalsndioadiaiwooidwa</p>',image:"https://cms.beijing.academy/media/original_images/DSC07614.webp"}],_='<p data-block-key="rnrb4">在北京中学开放创新的教育生态中，每一位教职员工都能找到发光发热的舞台。只要您热爱学生，有教育情怀，有国际视野，国际部热忱欢迎您的加盟！</p>',n="招聘条件",u='<h3 data-block-key="95l4k">整体要求</h3><ol><li data-block-key="2f57q">热爱孩子</li><li data-block-key="30m1t">具有较强的教学能力和丰富的教学经验</li><li data-block-key="588do">团结协作能力强</li><li data-block-key="84de2">同等条件下，具有相关学科骨干称号教师或海外留学背景优先</li></ol>',d='<h3 data-block-key="ryxm4">岗位要求</h3><ol><li data-block-key="bb7v9">教学岗位: 胜任高中 AP 学科双语教学，初中剑桥课程双语教学；有教学经验者优先</li><li data-block-key="4g7g">综合岗位: 熟悉学生留学申请的活动规划；擅长学生管理、英语突出或有留学背景者优先</li></ol>',r="招聘对象",y='<p data-block-key="35x8e">应届生、社会人员、成熟教师均可投递简历。</p><p data-block-key="es0me">京内在职在编教师，35 岁以下。具备骨干称号教师的可适当放宽年龄条件。</p><p data-block-key="3hjjb">对户籍和编制没有要求的业内优秀教师，可以不受以上限制。</p>',p="https://cms.beijing.academy/media/original_images/c1d81850626a45d3f325323c82eecce9.webp",f="提交简历方式、流程",m='<p data-block-key="6a0u2">个人简历发送至邮箱: <a href="mailto:baidhr@163.com">baidhr@163.com</a>；邮件标题为:</p><ul><li data-block-key="41i2f">在职教师: 岗位+学科+姓名+骨干称号</li><li data-block-key="5c3mj">应届毕业生: 应聘学科+学校+专业+姓名</li></ul>',k='<p data-block-key="d4pp4">邮箱投递时，简历中需体现的信息如下:</p><ol><li data-block-key="76tqh">个人基本情况</li><li data-block-key="7s8n3">毕业院校</li><li data-block-key="h2cs">工作经历</li><li data-block-key="f8aq3">在职期间所获区级及以上荣誉和学术成果</li></ol><p data-block-key="ed5gq">简历经学校初审通过后，将通过电话通知具体安排。</p>',g='<p data-block-key="bz8gb">联系方式</p><p data-block-key="fvckd">联系人: 李老师</p><p data-block-key="61rov">联系方式: 158 0129 8309 (待确认，李坤老师)</p>',E={id:17,meta:t,title:e,carousel_images:a,student:l,student_first_title:s,student_first_content:c,student_first_image:i,student_cards:o,faculty:_,faculty_requirements_title:n,faculty_requirements_left:u,faculty_requirements_right:d,faculty_card_title:r,faculty_card_content:y,faculty_card_image:p,faculty_process_title:f,faculty_process_left:m,faculty_process_right:k,faculty_epilogue:g},b=9,h={type:"join_us.JoinUs",detail_url:"http://localhost/api/v2/pages/9/",html_url:null,slug:"join-us",show_in_menus:!1,seo_title:"",search_description:"",first_published_at:"2023-06-08T23:14:55.657944Z",alias_of:null,parent:{id:11,meta:{type:"base.Base",detail_url:"http://localhost/api/v2/pages/11/",html_url:null},title:"BAID Website"},locale:"en"},$="Join Us",j=[],q="",v="",w="",C=null,D=[],A="",B="",I="",S="",x="",J="",T=null,U="",Z="",z="",P="",H={id:b,meta:h,title:$,carousel_images:j,student:q,student_first_title:v,student_first_content:w,student_first_image:C,student_cards:D,faculty:A,faculty_requirements_title:B,faculty_requirements_left:I,faculty_requirements_right:S,faculty_card_title:x,faculty_card_content:J,faculty_card_image:T,faculty_process_title:U,faculty_process_left:Z,faculty_process_right:z,faculty_epilogue:P};export{H as a,E as d};
